import React from 'react';
import { BrowserRouter } from 'react-router-dom';

import CoffeeList from './CoffeeList';
import CoffeeDetails from './CoffeeDetails';
import NavBar from './NavBar';

const App = () => {
	return (
		<div>
			<NavBar />
			<CoffeeList />
			<CoffeeDetails />
		</div>
	);
};

export default App;
